permisi pak saya mau nanya, dari kasus di bawah bagaimana pada fungsi protected saya ingin mendapatkan data dari hasil jwt decode bagaimana ya pak ?

```def token_required(f): # f or function_to_protect
  @wraps(f) # f or function_to_protect
  def decorated(*args, **kwargs):
    token = request.cookies.get('X-IIT-SESSION')

    if not token:
      return jsonify({'message': 'token is missing'}), 403

    try:
      data = jwt.decode(
        token,
        app.config['SECRET_KEY'],
        algorithms=["HS256"]
      )
    except:
      return jsonify({'message': 'token tidak valid'}), 403

    return f(*args, **kwargs)
  return decorated

@app.route('/protected')
@token_required
def protected():
  return jsonify({'message': "sukses"})```

